sys_variable_value.value:
(function execute(inputs, outputs) {
    var inputName = inputs.accountregistrationname ? inputs.accountregistrationname.trim() : '';
    gs.info('[Debug] Input accountregistrationname: [' + inputName + ']');

    var accountGR = new GlideRecord('customer_account');
    outputs.matches = [];

    if (inputName) {
        accountGR.addQuery('name', 'CONTAINS', inputName);
        accountGR.query();

        while (accountGR.next()) {
            outputs.matches.push({
                sys_id: String(accountGR.getUniqueValue()),
                name: String(accountGR.getValue('name')),
                street: String(accountGR.getValue('street')),
                city: String(accountGR.getValue('city')),
                state: String(accountGR.getValue('state')),
                zip: String(accountGR.getValue('zip')),
                dateofbirth: String(accountGR.getValue('u_date_of_birth')),
            });
        }
        gs.info('[Debug] Date of Birth: ' + accountGR.getValue('u_date_of_birth'));
        gs.info('[Debug] Matches found: ' + outputs.matches.length);
    } else {
        gs.warn('[Debug] Input was empty or undefined');
    }
})(inputs, outputs);

